<!DOCTYPE html><html lang="en"><head>    <meta charset="UTF-8">    <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1">    <script src="/down/script.js" defer></script>    <link rel="stylesheet" href="/down/style.css">    <title>Деловые Линии</title></head><body class="countdown-body"><header class="countdown-header">    <img class="countdown-logo-img" src="/down/assets/Logo.svg" alt="logo-svg"></header><main>    <img class="countdown-group-img" src="/down/assets/Group.svg" alt="dell group">    <p class="countdown-group-text">Осталось:</p>    <div class="countdown">        <div class="countdown-cell-container">            <div class="countdown-field-container">                <p class="countdown-days"></p>            </div>            <div>                <p class="countdown-number-format">Дней</p>            </div>        </div>        <div class="countdown-cell-container">            <div class="countdown-field-container">                <p class="countdown-hours"></p>            </div>            <div>                <p class="countdown-number-format">Часов</p>            </div>        </div>        <div class="countdown-cell-container">            <div class="countdown-field-container">                <p class="countdown-minutes"></p>            </div>            <div>                <p class="countdown-number-format">Минут</p>            </div>        </div>        <div class="countdown-cell-container">            <div class="countdown-field-container">                <p class="countdown-seconds"></p>            </div>            <div>                <p class="countdown-number-format">Секунд</p>            </div>        </div>    </div></main><footer>    <p class="countdown-footer-text">© ГК «Деловые Линии», 2001–2021</p>    <img class="countdown-footer-img" src="/down/assets/Frame.svg" alt="dell frame"></footer></body></html>